-- ----------------------------
-- View structure for assessment_students
-- ----------------------------
DROP VIEW IF EXISTS `assessment_students`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `assessment_students` AS select `student_master`.`Register_Number` AS `Register_Number`,`student_master`.`Student_Name` AS `Student_Name`,`assessment_configuration`.`Course_Name` AS `Course_Name`,`assessment_configuration`.`Dept_Code` AS `Dept_Code`,`assessment_configuration`.`Dept_Name` AS `Dept_Name`,`assessment_configuration`.`Semester` AS `Semester`,`assessment_configuration`.`Regulation` AS `Regulation`,`assessment_configuration`.`Class_Section` AS `Class_Section`,`assessment_configuration`.`Sub_Code` AS `Sub_Code`,`assessment_configuration`.`Sub_Name` AS `Sub_Name`,`assessment_configuration`.`Assessment_Type` AS `Assessment_Type`,`assessment_configuration`.`Assessment_Date` AS `Assessment_Date`,`assessment_configuration`.`Max_Marks` AS `Max_Marks`,`assessment_configuration`.`Test_No` AS `Test_No`,`assessment_configuration`.`Experiment_Count` AS `Experiment_Count` from (`assessment_configuration` left join `student_master` on(((`assessment_configuration`.`Course_Name` = `student_master`.`Course_Name`) and (`assessment_configuration`.`Dept_Name` = `student_master`.`Dept_Name`) and (`assessment_configuration`.`Dept_Code` = `student_master`.`Dept_Code`) and (`assessment_configuration`.`Semester` = `student_master`.`Semester`) and (`assessment_configuration`.`Regulation` = `student_master`.`Regulation`) and (`assessment_configuration`.`Class_Section` = `student_master`.`Class`))));

-- ----------------------------
-- View structure for assignment_summary
-- ----------------------------
DROP VIEW IF EXISTS `assignment_summary`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `assignment_summary` AS select `assignment_mark_entered`.`Register_Number` AS `Register_Number`,`assignment_mark_entered`.`Sub_Code` AS `Sub_Code`,sum(`assignment_mark_entered`.`Obtained_Mark`) AS `total_assignment_mark`,sum(`assignment_mark_entered`.`Max_Marks`) AS `total_assignment_max`,round(((sum(`assignment_mark_entered`.`Obtained_Mark`) / sum(`assignment_mark_entered`.`Max_Marks`)) * 100),2) AS `assignment_percentage` from `assignment_mark_entered` group by `assignment_mark_entered`.`Register_Number`,`assignment_mark_entered`.`Sub_Code`;

-- ----------------------------
-- View structure for attendance_summary
-- ----------------------------
DROP VIEW IF EXISTS `attendance_summary`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `attendance_summary` AS select `student_attendance_entry`.`Register_Number` AS `Register_Number`,`student_attendance_entry`.`Subject_Code` AS `Sub_Code`,count(0) AS `total_classes`,sum((case when (`student_attendance_entry`.`Att_Status` in ('P','OD')) then 1 else 0 end)) AS `present_days`,round(((sum((case when (`student_attendance_entry`.`Att_Status` in ('P','OD')) then 1 else 0 end)) / count(0)) * 100),2) AS `attendance_percentage` from `student_attendance_entry` group by `student_attendance_entry`.`Register_Number`,`student_attendance_entry`.`Subject_Code`;

-- ----------------------------
-- View structure for available_quota_seat
-- ----------------------------
DROP VIEW IF EXISTS `available_quota_seat`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `available_quota_seat` AS select `cd`.`Dept_Code` AS `Dept_Code`,`cd`.`Dept_Name` AS `Dept_Name`,`cd`.`Course_Name` AS `Course_Name`,`cd`.`GoiQuota` AS `total_gq_seats`,`cd`.`MgtQuota` AS `total_mq_seats`,(`cd`.`GoiQuota` + `cd`.`MgtQuota`) AS `total_seats`,(select count(0) from `student_master` `sm1` where ((`sm1`.`Dept_Code` = `cd`.`Dept_Code`) and (`sm1`.`Course_Name` = `cd`.`Course_Name`) and (`sm1`.`Admission_Status` = 'Admitted') and (`sm1`.`Allocated_Quota` = 'GQ'))) AS `admitted_gq`,(select count(0) from `student_master` `sm2` where ((`sm2`.`Dept_Code` = `cd`.`Dept_Code`) and (`sm2`.`Course_Name` = `cd`.`Course_Name`) and (`sm2`.`Admission_Status` = 'Admitted') and (`sm2`.`Allocated_Quota` = 'MQ'))) AS `admitted_mq`,(`cd`.`GoiQuota` - (select count(0) from `student_master` `sm1` where ((`sm1`.`Dept_Code` = `cd`.`Dept_Code`) and (`sm1`.`Course_Name` = `cd`.`Course_Name`) and (`sm1`.`Admission_Status` = 'Admitted') and (`sm1`.`Allocated_Quota` = 'GQ')))) AS `available_gq`,(`cd`.`MgtQuota` - (select count(0) from `student_master` `sm2` where ((`sm2`.`Dept_Code` = `cd`.`Dept_Code`) and (`sm2`.`Course_Name` = `cd`.`Course_Name`) and (`sm2`.`Admission_Status` = 'Admitted') and (`sm2`.`Allocated_Quota` = 'MQ')))) AS `available_mq` from `course_details` `cd` order by `cd`.`Dept_Code`,`cd`.`Course_Name`;

-- ----------------------------
-- View structure for dept_attendance_date_wise
-- ----------------------------
DROP VIEW IF EXISTS `dept_attendance_date_wise`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `dept_attendance_date_wise` AS select `a`.`Att_Date` AS `Att_Date`,`a`.`Dept_Code` AS `Dept_Code`,`a`.`Dept_Name` AS `Dept_Name`,count(distinct (case when (`a`.`Att_Status` in ('present','onDuty')) then `a`.`Register_Number` end)) AS `present_count`,count(distinct (case when (`a`.`Att_Status` in ('absent','medicalLeave')) then `a`.`Register_Number` end)) AS `absent_count`,`s`.`total_students` AS `total_students`,round(((count(distinct (case when (`a`.`Att_Status` in ('present','onDuty')) then `a`.`Register_Number` end)) * 100.0) / nullif(`s`.`total_students`,0)),0) AS `present_percentage`,round(((count(distinct (case when (`a`.`Att_Status` in ('absent','medicalLeave')) then `a`.`Register_Number` end)) * 100.0) / nullif(`s`.`total_students`,0)),0) AS `absent_percentage` from (`student_attendance_entry` `a` join (select `student_master`.`Dept_Code` AS `Dept_Code`,count(0) AS `total_students` from `student_master` where (`student_master`.`Admission_Status` = 'Admitted') group by `student_master`.`Dept_Code`) `s` on((`s`.`Dept_Code` = `a`.`Dept_Code`))) group by `a`.`Att_Date`,`a`.`Dept_Code`,`a`.`Dept_Name`,`s`.`total_students` order by `a`.`Att_Date`;

-- ----------------------------
-- View structure for enquiry_call_notes_tenant
-- ----------------------------
DROP VIEW IF EXISTS `enquiry_call_notes_tenant`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `enquiry_call_notes_tenant` AS select `td`.`staff_name` AS `staff_name`,`td`.`staff_id` AS `staff_id`,`td`.`staff_mobile` AS `staff_mobile`,`td`.`staff_department` AS `staff_department`,`td`.`tenant_id` AS `tenant_id`,`td`.`student_eqid` AS `student_eqid`,`td`.`student_name` AS `student_name`,`td`.`student_mobile` AS `student_mobile`,`td`.`parent_name` AS `parent_name`,`td`.`parent_mobile` AS `parent_mobile`,`td`.`student_address` AS `student_address`,`td`.`student_district` AS `student_district`,`td`.`student_community` AS `student_community`,`td`.`school_type` AS `school_type`,`td`.`standard` AS `standard`,`td`.`student_reg_no` AS `student_reg_no`,`td`.`school_address` AS `school_address`,`td`.`department` AS `department`,`td`.`source` AS `source`,`td`.`transport` AS `transport`,`td`.`hostel` AS `hostel`,coalesce(`cnt`.`call_notes_count`,0) AS `call_notes_count`,`last_call`.`outcome` AS `last_status`,`last_call`.`next_follow_up` AS `next_follow_up`,`td`.`CreatedAt` AS `Created_Date` from ((`tenant_details` `td` left join (select `enquiry_call_notes`.`student_eqid` AS `student_eqid`,`enquiry_call_notes`.`tenant_id` AS `tenant_id`,count(0) AS `call_notes_count` from `enquiry_call_notes` where (`enquiry_call_notes`.`call_note_date` is not null) group by `enquiry_call_notes`.`student_eqid`,`enquiry_call_notes`.`tenant_id`) `cnt` on(((`td`.`student_eqid` = `cnt`.`student_eqid`) and (`td`.`staff_id` = `cnt`.`tenant_id`)))) left join (select `e1`.`student_eqid` AS `student_eqid`,`e1`.`tenant_id` AS `tenant_id`,`e1`.`outcome` AS `outcome`,`e1`.`next_follow_up` AS `next_follow_up` from (`enquiry_call_notes` `e1` join (select `enquiry_call_notes`.`student_eqid` AS `student_eqid`,`enquiry_call_notes`.`tenant_id` AS `tenant_id`,max(concat(`enquiry_call_notes`.`call_note_date`,' ',`enquiry_call_notes`.`call_note_time`)) AS `last_call_dt` from `enquiry_call_notes` where (`enquiry_call_notes`.`call_note_date` is not null) group by `enquiry_call_notes`.`student_eqid`,`enquiry_call_notes`.`tenant_id`) `e2` on(((`e1`.`student_eqid` = `e2`.`student_eqid`) and (`e1`.`tenant_id` = `e2`.`tenant_id`) and (concat(`e1`.`call_note_date`,' ',`e1`.`call_note_time`) = `e2`.`last_call_dt`))))) `last_call` on(((`td`.`student_eqid` = `last_call`.`student_eqid`) and (`td`.`staff_id` = `last_call`.`tenant_id`))));

