DROP VIEW IF EXISTS `exam_seat_plan_report`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `exam_seat_plan_report` AS select `eg`.`exam_date` AS `exam_date`,`ac`.`Day_Order` AS `day_order`,`eg`.`session` AS `session`,`eg`.`subject_code` AS `subject_code`,`eg`.`subject_name` AS `subject_name`,`eg`.`dept_code` AS `dept_code`,trim(replace(substring_index(`eg`.`dept_name`,'(',-(1)),')','')) AS `dept_name`,substring_index(`eg`.`dept_name`,' ',1) AS `dept_short`,`eg`.`semester` AS `semester`,`eg`.`regulation` AS `regulation`,`eg`.`hall_code` AS `hall_code`,`eg`.`hall_name` AS `hall_name`,`eg`.`col` AS `col`,char((`eg`.`col` + 65)) AS `col_letter`,row_number() OVER (PARTITION BY `eg`.`exam_date`,`eg`.`session`,`eg`.`hall_code`,`eg`.`col` ORDER BY `eg`.`seat_no` )  AS `seat_index`,concat(char((`eg`.`col` + 65)),row_number() OVER (PARTITION BY `eg`.`exam_date`,`eg`.`session`,`eg`.`hall_code`,`eg`.`col` ORDER BY `eg`.`seat_no` ) ) AS `seat_label`,`eg`.`register_number` AS `register_number`,`eg`.`student_name` AS `student_name` from (`exam_generation` `eg` left join `academic_calendar` `ac` on((`ac`.`Calendar_Date` = `eg`.`exam_date`))) order by `eg`.`exam_date`,`eg`.`session`,`eg`.`hall_code`,`eg`.`col`,row_number() OVER (PARTITION BY `eg`.`exam_date`,`eg`.`session`,`eg`.`hall_code`,`eg`.`col` ORDER BY `eg`.`seat_no` ) ;

