DROP VIEW IF EXISTS `exam_timetable_student_list`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `exam_timetable_student_list` AS select `et`.`id` AS `exam_timetable_id`,`et`.`Exam_Date` AS `Exam_Date`,`et`.`Session` AS `Session`,`et`.`Dept_Code` AS `Dept_Code`,`et`.`QPC` AS `QPC`,`et`.`Regulation` AS `Regulation`,`et`.`Semester` AS `Semester`,`sm`.`Sub_Code` AS `Sub_Code`,`st`.`Register_Number` AS `Register_Number`,`st`.`Student_Name` AS `Student_Name`,'R' AS `Exam_Type` from ((`exam_timetable` `et` join `subject_master` `sm` on(((`sm`.`QPC` = `et`.`QPC`) and (`sm`.`Dept_Code` = `et`.`Dept_Code`)))) join `student_master` `st` on(((`st`.`Dept_Code` = `et`.`Dept_Code`) and (`st`.`Admission_Status` = 'Admitted') and (find_in_set(`sm`.`Sub_Code`,(case `et`.`Semester` when 1 then `st`.`S1` when 2 then `st`.`S2` when 3 then `st`.`S3` when 4 then `st`.`S4` when 5 then `st`.`S5` when 6 then `st`.`S6` when 7 then `st`.`S7` when 8 then `st`.`S8` end)) > 0)))) union all select `et`.`id` AS `exam_timetable_id`,`et`.`Exam_Date` AS `Exam_Date`,`et`.`Session` AS `Session`,`et`.`Dept_Code` AS `Dept_Code`,`et`.`QPC` AS `QPC`,`et`.`Regulation` AS `Regulation`,`et`.`Semester` AS `Semester`,`sm`.`Sub_Code` AS `Sub_Code`,`st`.`Register_Number` AS `Register_Number`,`st`.`Student_Name` AS `Student_Name`,'A' AS `Exam_Type` from ((`exam_timetable` `et` join `subject_master` `sm` on(((`sm`.`QPC` = `et`.`QPC`) and (`sm`.`Dept_Code` = `et`.`Dept_Code`)))) join `student_master` `st` on(((`st`.`Dept_Code` = `et`.`Dept_Code`) and (`st`.`Admission_Status` = 'Admitted') and (((`et`.`Semester` > 1) and (find_in_set(`sm`.`Sub_Code`,`st`.`S1`) > 0)) or ((`et`.`Semester` > 2) and (find_in_set(`sm`.`Sub_Code`,`st`.`S2`) > 0)) or ((`et`.`Semester` > 3) and (find_in_set(`sm`.`Sub_Code`,`st`.`S3`) > 0)) or ((`et`.`Semester` > 4) and (find_in_set(`sm`.`Sub_Code`,`st`.`S4`) > 0)) or ((`et`.`Semester` > 5) and (find_in_set(`sm`.`Sub_Code`,`st`.`S5`) > 0)) or ((`et`.`Semester` > 6) and (find_in_set(`sm`.`Sub_Code`,`st`.`S6`) > 0)) or ((`et`.`Semester` > 7) and (find_in_set(`sm`.`Sub_Code`,`st`.`S7`) > 0))))));

