DROP VIEW IF EXISTS `overall_att_date_wise`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `overall_att_date_wise` AS select `d`.`Att_Date` AS `Att_Date`,sum(`d`.`present_count`) AS `total_present`,sum(`d`.`absent_count`) AS `total_absent`,sum(`d`.`total_students`) AS `total_students`,round(((sum(`d`.`present_count`) * 100.0) / nullif(sum(`d`.`total_students`),0)),0) AS `overall_present_percentage`,round(((sum(`d`.`absent_count`) * 100.0) / nullif(sum(`d`.`total_students`),0)),0) AS `overall_absent_percentage` from `dept_attendance_date_wise` `d` group by `d`.`Att_Date` order by `d`.`Att_Date`;

