Academic_Year`,`subject_allocation`.`Course_Name` AS `Course_Name`,`subject_allocation`.`Dept_Code` AS `Dept_Code`,`subject_allocation`.`Dept_Name` AS `Dept_Name`,`subject_allocation`.`Semester` AS `Semester`,`subject_allocation`.`Regulation` AS `Regulation`,`subject_allocation`.`Sub4_Code` AS `Subject_Code`,`subject_allocation`.`Sub4_Name` AS `Subject_Name` from `subject_allocation` where (`subject_allocation`.`Sub4_Code` is not null) union all select `subject_allocation`.`Staff_Id` AS `Staff_Id`,`subject_allocation`.`Staff_Name` AS `Staff_Name`,`subject_allocation`.`Academic_Year` AS `Academic_Year`,`subject_allocation`.`Course_Name` AS `Course_Name`,`subject_allocation`.`Dept_Code` AS `Dept_Code`,`subject_allocation`.`Dept_Name` AS `Dept_Name`,`subject_allocation`.`Semester` AS `Semester`,`subject_allocation`.`Regulation` AS `Regulation`,`subject_allocation`.`Sub5_Code` AS `Subject_Code`,`subject_allocation`.`Sub5_Name` AS `Subject_Name` from `subject_allocation` where (`subject_allocation`.`Sub5_Code` is not null);

