-- View structure for student_attendance_view
-- ----------------------------
DROP VIEW IF EXISTS `student_attendance_view`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `student_attendance_view` AS select `s`.`Att_Date` AS `date`,`s`.`Day_Order` AS `dayorder`,`s`.`Dept_Code` AS `dept_code`,`s`.`Dept_Name` AS `dept_name`,`s`.`Semester` AS `semester`,`s`.`Regulation` AS `regulation`,`s`.`Class` AS `class`,`s`.`Register_Number` AS `register_number`,coalesce(`m`.`Student_Name`,'') AS `name`,max((case when (`s`.`Period` = 1) then (case when (`s`.`Att_Status` = 'onduty') then 'OD' when (`s`.`Att_Status` = 'absent') then 'Ab' when (`s`.`Att_Status` = 'present') then 'Pr' when (`s`.`Att_Status` = 'medical leave') then 'ML' end) end)) AS `1`,max((case when (`s`.`Period` = 2) then (case when (`s`.`Att_Status` = 'onduty') then 'OD' when (`s`.`Att_Status` = 'absent') then 'Ab' when (`s`.`Att_Status` = 'present') then 'Pr' when (`s`.`Att_Status` = 'medical leave') then 'ML' end) end)) AS `2`,max((case when (`s`.`Period` = 3) then (case when (`s`.`Att_Status` = 'onduty') then 'OD' when (`s`.`Att_Status` = 'absent') then 'Ab' when (`s`.`Att_Status` = 'present') then 'Pr' when (`s`.`Att_Status` = 'medical leave') then 'ML' end) end)) AS `3`,max((case when (`s`.`Period` = 4) then (case when (`s`.`Att_Status` = 'onduty') then 'OD' when (`s`.`Att_Status` = 'absent') then 'Ab' when (`s`.`Att_Status` = 'present') then 'Pr' when (`s`.`Att_Status` = 'medical leave') then 'ML' end) end)) AS `4`,max((case when (`s`.`Period` = 5) then (case when (`s`.`Att_Status` = 'onduty') then 'OD' when (`s`.`Att_Status` = 'absent') then 'Ab' when (`s`.`Att_Status` = 'present') then 'Pr' when (`s`.`Att_Status` = 'medical leave') then 'ML' end) end)) AS `5`,max((case when (`s`.`Period` = 6) then (case when (`s`.`Att_Status` = 'onduty') then 'OD' when (`s`.`Att_Status` = 'absent') then 'Ab' when (`s`.`Att_Status` = 'present') then 'Pr' when (`s`.`Att_Status` = 'medical leave') then 'ML' end) end)) AS `6` from (`student_attendance_entry` `s` left join `student_master` `m` on((`s`.`Register_Number` = `m`.`Register_Number`))) group by `s`.`Att_Date`,`s`.`Day_Order`,`s`.`Dept_Code`,`s`.`Dept_Name`,`s`.`Semester`,`s`.`Regulation`,`s`.`Class`,`s`.`Register_Number`,`m`.`Student_Name` order by `s`.`Att_Date`,`s`.`Register_Number`;

