CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `student_fees_details_view` AS select `sm`.`Register_Number` AS `Register_Number`,`sm`.`Student_Name` AS `Student_Name`,`sm`.`Course_Name` AS `Course_Name`,`sm`.`Dept_Code` AS `Dept_Code`,`sm`.`Semester` AS `Semester`,`sm`.`Year` AS `Year`,`sm`.`Regulation` AS `Regulation`,`fd`.`Academic_Year` AS `Academic_Year`,`sm`.`Mode_Of_Joinig` AS `Mode_of_Joining`,`fd`.`Fees_Type` AS `Fees_Type`,`fd`.`Type` AS `Fee_Category`,`fd`.`Amount` AS `Amount`,`sm`.`Hostel_Required` AS `Hostel_Required`,`sm`.`Transport_Required` AS `Transport_Required` from (`student_master` `sm` join `fees_details` `fd` on(((`fd`.`Dept_Code` = `sm`.`Dept_Code`) and (`fd`.`Semester` = `sm`.`Semester`) and (`fd`.`Year` = `sm`.`Year`) and (`fd`.`Academic_Year` = `sm`.`Academic_Year`) and ((`fd`.`Mode_of_Join` = 'Both') or (`fd`.`Mode_of_Join` = `sm`.`Mode_Of_Joinig`))))) where ((`fd`.`Type` not in ('Hostel','Transport')) or ((`fd`.`Type` = 'Hostel') and (`sm`.`Hostel_Required` = 'Yes')) or ((`fd`.`Type` = 'Transport') and (`sm`.`Transport_Required` = 'Yes')));

