DROP VIEW IF EXISTS `student_weekly_attendance`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `student_weekly_attendance` AS select `s`.`Att_Date` AS `date`,month(`s`.`Att_Date`) AS `month_no`,monthname(`s`.`Att_Date`) AS `month_name`,ceiling((dayofmonth(`s`.`Att_Date`) / 6)) AS `week_no`,`s`.`Day_Order` AS `dayorder`,`s`.`Dept_Code` AS `Dept_Code`,`s`.`Dept_Name` AS `Dept_Name`,`s`.`Semester` AS `Semester`,`s`.`Regulation` AS `Regulation`,`s`.`Class` AS `Class`,`s`.`Register_Number` AS `Register_Number`,coalesce(`m`.`Student_Name`,'') AS `name`,max((case when (`s`.`Period` = 1) then (case when (`s`.`Att_Status` = 'onduty') then 'OD' when (`s`.`Att_Status` = 'absent') then 'Ab' when (`s`.`Att_Status` = 'present') then 'Pr' when (`s`.`Att_Status` = 'medical leave') then 'ML' end) end)) AS `P1`,max((case when (`s`.`Period` = 2) then (case when (`s`.`Att_Status` = 'onduty') then 'OD' when (`s`.`Att_Status` = 'absent') then 'Ab' when (`s`.`Att_Status` = 'present') then 'Pr' when (`s`.`Att_Status` = 'medical leave') then 'ML' end) end)) AS `P2`,max((case when (`s`.`Period` = 3) then (case when (`s`.`Att_Status` = 'onduty') then 'OD' when (`s`.`Att_Status` = 'absent') then 'Ab' when (`s`.`Att_Status` = 'present') then 'Pr' when (`s`.`Att_Status` = 'medical leave') then 'ML' end) end)) AS `P3`,max((case when (`s`.`Period` = 4) then (case when (`s`.`Att_Status` = 'onduty') then 'OD' when (`s`.`Att_Status` = 'absent') then 'Ab' when (`s`.`Att_Status` = 'present') then 'Pr' when (`s`.`Att_Status` = 'medical leave') then 'ML' end) end)) AS `P4`,max((case when (`s`.`Period` = 5) then (case when (`s`.`Att_Status` = 'onduty') then 'OD' when (`s`.`Att_Status` = 'absent') then 'Ab' when (`s`.`Att_Status` = 'present') then 'Pr' when (`s`.`Att_Status` = 'medical leave') then 'ML' end) end)) AS `P5`,max((case when (`s`.`Period` = 6) then (case when (`s`.`Att_Status` = 'onduty') then 'OD' when (`s`.`Att_Status` = 'absent') then 'Ab' when (`s`.`Att_Status` = 'present') then 'Pr' when (`s`.`Att_Status` = 'medical leave') then 'ML' end) end)) AS `P6` from (`student_attendance_entry` `s` left join `student_master` `m` on((`s`.`Register_Number` = `m`.`Register_Number`))) group by `s`.`Att_Date`,month(`s`.`Att_Date`),monthname(`s`.`Att_Date`),ceiling((dayofmonth(`s`.`Att_Date`) / 6)),`s`.`Day_Order`,`s`.`Dept_Code`,`s`.`Dept_Name`,`s`.`Semester`,`s`.`Regulation`,`s`.`Class`,`s`.`Register_Number`,`m`.`Student_Name` order by month(`s`.`Att_Date`),ceiling((dayofmonth(`s`.`Att_Date`) / 6)),`s`.`Att_Date`,`s`.`Register_Number`;

