-- ----------------------------
DROP VIEW IF EXISTS `subject_consolidated_report`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `subject_consolidated_report` AS select `a`.`Register_Number` AS `Register_Number`,`a`.`Sub_Code` AS `Sub_Code`,`a`.`assignment_percentage` AS `assignment_percentage`,`u`.`unit_test_percentage` AS `unit_test_percentage`,`p`.`practical_percentage` AS `practical_percentage`,`atd`.`attendance_percentage` AS `attendance_percentage`,round(((((`a`.`assignment_percentage` * 0.20) + (`u`.`unit_test_percentage` * 0.30)) + (`p`.`practical_percentage` * 0.30)) + (`atd`.`attendance_percentage` * 0.20)),2) AS `final_consolidated_percentage` from (((`assignment_summary` `a` left join `unit_test_summary` `u` on(((`a`.`Register_Number` = `u`.`Register_Number`) and (`a`.`Sub_Code` = `u`.`Sub_Code`)))) left join `practical_summary` `p` on(((`a`.`Register_Number` = `p`.`Register_Number`) and (`a`.`Sub_Code` = `p`.`Sub_Code`)))) left join `attendance_summary` `atd` on(((`a`.`Register_Number` = `atd`.`Register_Number`) and (`a`.`Sub_Code` = `atd`.`Sub_Code`))));

-- ----------------------------
-- View structure for tenant_data
-- ----------------------------
DROP VIEW IF EXISTS `tenant_data`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `tenant_data` AS select `users`.`role` AS `role`,`users`.`staff_name` AS `staff_name`,`users`.`staff_id` AS `staff_id`,`staff_master`.`Dept_Name` AS `Dept_Name`,`staff_master`.`Dept_Code` AS `Dept_Code`,`staff_master`.`Mobile` AS `Mobile`,`staff_master`.`Gender` AS `Gender`,`staff_master`.`Email` AS `Email` from (`users` left join `staff_master` on((`users`.`staff_id` = `staff_master`.`Staff_ID`))) where (`users`.`role` like '%Tenant%');

-- ----------------------------
-- View structure for timetable_period
-- ----------------------------
DROP VIEW IF EXISTS `timetable_period`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `timetable_period` AS select `ac`.`Calendar_Date` AS `Calendar_Date`,`ac`.`Day_Order` AS `Day_Order`,`ct`.`Course_Name` AS `Course_Name`,`ct`.`Dept_Code` AS `Dept_Code`,`ct`.`Dept_Name` AS `Dept_Name`,`ct`.`Class_Section` AS `Class_Section`,`ct`.`Semester` AS `Semester`,`ct`.`Regulation` AS `Regulation`,`periods`.`period_no` AS `period_no`,trim(substring_index(substring_index(`periods`.`Sub_Code`,'/',`nums`.`n`),'/',-(1))) AS `Sub_Code`,`sm`.`Sub_Name` AS `Sub_Name`,`sm`.`Dept_Code` AS `Subject_Dept` from ((((`academic_calendar` `ac` join `class_timetable` `ct` on(((`ac`.`Day_Order` = `ct`.`Day_Order`) and (`ac`.`Status` = 'W')))) join (select `class_timetable`.`Id` AS `Id`,`class_timetable`.`Day_Order` AS `Day_Order`,`class_timetable`.`Period_1` AS `Sub_Code`,1 AS `period_no` from `class_timetable` union all select `class_timetable`.`Id` AS `Id`,`class_timetable`.`Day_Order` AS `Day_Order`,`class_timetable`.`Period_2` AS `Sub_Code`,2 AS `period_no` from `class_timetable`) `periods` on(((`periods`.`Id` = `ct`.`Id`) and (`periods`.`Day_Order` = `ct`.`Day_Order`)))) join (select 1 AS `n` union all select 2 AS `2` union all select 3 AS `3` union all select 4 AS `4` union all select 5 AS `5`) `nums` on((`nums`.`n` <= ((1 + length(`periods`.`Sub_Code`)) - length(replace(`periods`.`Sub_Code`,'/','')))))) left join `subject_master` `sm` on((`sm`.`Sub_Code` = trim(substring_index(substring_index(`periods`.`Sub_Code`,'/',`nums`.`n`),'/',-(1)))))) order by `ac`.`Calendar_Date`,`periods`.`period_no`;

-- ----------------------------
-- View structure for total_caller_count
-- ----------------------------
DROP VIEW IF EXISTS `total_caller_count`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `total_caller_count` AS select `enquiry_call_notes_tenant`.`tenant_id` AS `tenant_id`,`enquiry_call_notes_tenant`.`staff_name` AS `staff_name`,`enquiry_call_notes_tenant`.`staff_id` AS `staff_id`,`enquiry_call_notes_tenant`.`staff_mobile` AS `staff_mobile`,`enquiry_call_notes_tenant`.`staff_department` AS `staff_department`,count(`enquiry_call_notes_tenant`.`student_eqid`) AS `total_students`,sum((case when (`enquiry_call_notes_tenant`.`call_notes_count` <> '0') then 1 else 0 end)) AS `total_calls`,sum((case when (`enquiry_call_notes_tenant`.`last_status` = 'Confirmed') then 1 else 0 end)) AS `converted_students`,round(((sum((case when (`enquiry_call_notes_tenant`.`last_status` = 'Confirmed') then 1 else 0 end)) / count(`enquiry_call_notes_tenant`.`student_eqid`)) * 100),2) AS `conversion_percentage` from `enquiry_call_notes_tenant` group by `enquiry_call_notes_tenant`.`tenant_id`,`enquiry_call_notes_tenant`.`staff_name`,`enquiry_call_notes_tenant`.`staff_id`,`enquiry_call_notes_tenant`.`staff_mobile`,`enquiry_call_notes_tenant`.`staff_department`;

-- ----------------------------
-- View structure for total_working_days
-- ----------------------------
DROP VIEW IF EXISTS `total_working_days`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `total_working_days` AS select count(0) AS `total_days`,sum((case when (`academic_calendar`.`Status` = 'W') then 1 else 0 end)) AS `total_working_days`,sum((case when (`academic_calendar`.`Status` = 'H') then 1 else 0 end)) AS `total_holidays`,round((sum((case when (`academic_calendar`.`Status` = 'W') then 1 else 0 end)) / 7),0) AS `total_weeks` from `academic_calendar`;

-- ----------------------------
-- View structure for unit_test_summary
-- ----------------------------
DROP VIEW IF EXISTS `unit_test_summary`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `unit_test_summary` AS select `unit_test_mark_entered`.`Register_Number` AS `Register_Number`,`unit_test_mark_entered`.`Sub_Code` AS `Sub_Code`,sum(`unit_test_mark_entered`.`Obtained_Mark`) AS `total_unit_mark`,sum(`unit_test_mark_entered`.`Max_Marks`) AS `total_unit_max`,round(((sum(`unit_test_mark_entered`.`Obtained_Mark`) / sum(`unit_test_mark_entered`.`Max_Marks`)) * 100),2) AS `unit_test_percentage` from `unit_test_mark_entered` group by `unit_test_mark_entered`.`Register_Number`,`unit_test_mark_entered`.`Sub_Code`;

SET FOREIGN_KEY_CHECKS = 1;
